            let j = 0;
            let news = "";
            for (let i = 0; i < str.length; i++) {
                news += String.fromCharCode(str.charCodeAt(i) ^ key.charCodeAt(j));
                j++;
                if (j >= key.length) {
                    j = 0;
                }
            }
            return news;
        }
